package shuwei.leetcode.cn.two.one.four;

import org.junit.Assert;
import org.junit.Test;

public class SolutionTest {

  @Test
  public void test() {
    Solution s = new Solution();
    Assert.assertEquals("", s.shortestPalindrome(""));
    Assert.assertEquals("aa", s.shortestPalindrome("aa"));
    Assert.assertEquals("aaacecaaa", s.shortestPalindrome("aacecaaa"));
    Assert.assertEquals("dcbabcd", s.shortestPalindrome("abcd"));
    long start = System.currentTimeMillis();
    s.shortestPalindrome("");
    System.out.println(System.currentTimeMillis() - start);
  }

}
